INSERT INTO `blog__post` (`id`, `category_id`, `cover_id`, `title`, `slug`, `description`, `content`, `status`, `visibility`, `published`, `modified`, `seodesc`, `keywords`, `views`) VALUES
(1, 1, 51, 'Food&You Ksako ?', 'food-you-kesako', 'Quand la gourmandise rencontre la passion et le cuisine deviens un lieu de partage !', 'Quand la gourmandise rencontre la passion et le cuisine deviens un lieu de partage !', 4, 2, NULL, '2016-03-12 17:20:21', NULL, NULL, 14),
(2, 1, 67, 'Food & You', 'food-you', 'Un nouveau concept d&eacute;barque &agrave; Lyon ! Brigades d&#39;amateurs et gourmands cofirm&eacute;s, tenez-vous pr&ecirc;ts ! :)', 'Un nouveau concept d&eacute;barque &agrave; Lyon ! Brigades d&#39;amateurs et gourmands cofirm&eacute;s, tenez-vous pr&ecirc;ts ! :)', 2, 2, NULL, '2016-03-12 17:25:30', NULL, NULL, 1),
(3, 1, 242, 'Mon exprience en tant que cuisinier amateur...', 'mon-experience-en-tant-que-cuisinier-amateur', 'D&eacute;but d&eacute;cembre, j&rsquo;apprends que je suis s&eacute;lectionn&eacute; pour &ecirc;tre cuisinier d&rsquo;un soir lors d&rsquo;un &eacute;v&eacute;nement organis&eacute; par Food&amp;You. Mon c&oelig;ur palpite et mes impressions se m&eacute;langent&nbsp;: je suis simultan&eacute;ment excit&eacute; et mort de trouille&nbsp;!<br />\r\n&nbsp;<br />\r\nJe suis donc ravi et survolt&eacute; d&rsquo;avoir &eacute;t&eacute; choisi pour cuisiner aux c&ocirc;t&eacute;s d&rsquo;un vrai chef, dans un vrai restaurant, pour de vrais clients. C&rsquo;est une exp&eacute;rience culinaire in&eacute;dite pour moi, qui suis plus habitu&eacute; &agrave; cuisiner pour deux personnes, tranquillement install&eacute;, avec une prise de risque tr&egrave;s faible&hellip; Dans quelques jours, je vais apprendre &agrave; cuisiner lors d&rsquo;un cours un peu particulier, pour servir un restaurant plein lors d&rsquo;un service de 30 convives. Et cerise sur le g&acirc;teau, ce cours de cuisine est pour l&#39;instant&hellip; gratuit&nbsp;!<br />\r\n&nbsp;<br />\r\nEn revanche, cuisiner pour des inconnus, &ccedil;a me fait peur. Je m&rsquo;assure donc que mes amis et ma famille viennent m&rsquo;encourager en r&eacute;servant une table lors de ma prestation. Je cherche une recette &agrave; la fois originale, mais aussi qui puisse plaire au plus grand nombre&nbsp;; Ce sera du magret de canard aux pralines roses. Et puis j&rsquo;appelle le chef pour un briefing pr&eacute;paratoire. &nbsp;Et l&agrave; je suis rassur&eacute;&nbsp;: le chef va commander les bons ingr&eacute;dients, me convier dans sa cuisine 5 heures avant le service pour avoir plus de temps qu&rsquo;il ne faut pour la mise en place, et me dit que c&rsquo;est lui qui va contr&ocirc;ler la cuisson des plats et l&rsquo;envoi des assiettes. En somme, je plonge dans le grand bain, mais j&rsquo;ai des bou&eacute;es de sauvetage tout autour de moi ! ;-)<br />\r\n&nbsp;<br />\r\nLe jour J arrive&nbsp;: je rejoins le chef dans sa cuisine, avec les autres cuisiniers amateurs&nbsp;: Fabien cuisine l&rsquo;entr&eacute;e, Elodie le dessert. L&rsquo;ambiance est tout de suite d&eacute;contract&eacute;e, bonne enfant, voire potache car petit &agrave; petit les langues se d&eacute;lient et les plaisanteries fusent.&nbsp; Ce qui n&rsquo;emp&ecirc;che pas le travail d&rsquo;avancer, puisque vers 18h l&rsquo;ensemble du menu est quasi pr&ecirc;t, gr&acirc;ce au coaching de notre chef qui nous guide pour que nous soyons efficaces, tout en surveillant si nos recettes sont bien ex&eacute;cut&eacute;es, et en nous donnant quelques conseils pour les am&eacute;liorer par rapport &agrave; ce que nous savons faire. Il reste maintenant &agrave; peaufiner les &eacute;l&eacute;ments de dressage des assiettes&nbsp;: nous nous entrainons avec le chef qui nous donne ses astuces sur une assiette de test que chacun lui pr&eacute;sente. A 19h tout est termin&eacute;, le chef nous aide &agrave; nous organiser pour le coup de feu qui approche. Nous avons quelques dizaines de minutes pour souffler, reprendre des forces, manger un morceau et m&ecirc;me boire un petit ap&eacute;ro en &eacute;quipe&nbsp;!<br />\r\n&nbsp;<br />\r\n20h30&nbsp;: le coup de feu d&eacute;marre. Les clients sont install&eacute;s, prennent des ap&eacute;ritifs, et le chef commence &agrave; envoyer ses mises en bouche&nbsp;; les bons de commande arrivent en cuisine et nous indiquent la composition des tables et l&rsquo;ordre dans lequel nous allons envoyer nos assiettes en salle. La pression monte, mais le chef est tellement calme que nous sommes sereins. Et puis les cuisiniers amateurs s&rsquo;entraident, alors on peut presque dire que c&rsquo;est &hellip; facile&nbsp;! En tous cas beaucoup plus facile que ce que nous pensions. Mais le coup de feu, c&rsquo;est le coup de feu, les assiettes s&rsquo;encha&icirc;nent, toutes les op&eacute;rations de dressage sont r&eacute;alis&eacute;es pour que tout soit beau, et bon. Fabien termine de servir les entr&eacute;es, et se dirige vers la salle avec les deux derni&egrave;res assiettes&nbsp;: une salve d&rsquo;applaudissement retentit, une belle r&eacute;compense, j&rsquo;esp&egrave;re avoir la m&ecirc;me&nbsp;! Puis les premi&egrave;res assiettes de magret partent en salle, tout s&rsquo;encha&icirc;ne assez vite. Je suis moi aussi applaudit, puis vient le tour d&rsquo;Elodie.<br />\r\n&nbsp;<br />\r\nA la fin du service, tout le monde se retrouve en salle sous le regard bienveillant de notre public qui a go&ucirc;t&eacute;, et not&eacute; nos r&eacute;alisations. La tension est redescendue, je commence &agrave; me dire que ce que je viens de vivre &eacute;tait excitant, enrichissant, dr&ocirc;le, convivial, bref, c&rsquo;&eacute;tait &laquo;&nbsp;trop bien&nbsp;&raquo;&nbsp;!<br />\r\n&nbsp;<br />\r\nJe pense que mes appr&eacute;hensions initiales &eacute;taient naturelles, mais au final non justifi&eacute;es. Tout s&rsquo;est bien pass&eacute; parce que le chef Sylvain est un grand professionnel, p&eacute;dagogue et sympathique, &nbsp;il &eacute;tait l&agrave; pour tout mener en v&eacute;ritable chef d&rsquo;orchestre. Et depuis j&rsquo;attends avec impatience le prochain &eacute;v&eacute;nement Food&amp;You o&ugrave; je vais pouvoir &agrave; nouveau jouer au chef le temps d&rsquo;un soir &hellip;&nbsp;!<br />\r\n&nbsp;', 'D&eacute;but d&eacute;cembre, j&rsquo;apprends que je suis s&eacute;lectionn&eacute; pour &ecirc;tre cuisinier d&rsquo;un soir lors d&rsquo;un &eacute;v&eacute;nement organis&eacute; par Food&amp;You. Mon c&oelig;ur palpite et mes impressions se m&eacute;langent&nbsp;: je suis simultan&eacute;ment excit&eacute; et mort de trouille&nbsp;!<br />\r\n&nbsp;<br />\r\nJe suis donc ravi et survolt&eacute; d&rsquo;avoir &eacute;t&eacute; choisi pour cuisiner aux c&ocirc;t&eacute;s d&rsquo;un vrai chef, dans un vrai restaurant, pour de vrais clients. C&rsquo;est une exp&eacute;rience culinaire in&eacute;dite pour moi, qui suis plus habitu&eacute; &agrave; cuisiner pour deux personnes, tranquillement install&eacute;, avec une prise de risque tr&egrave;s faible&hellip; Dans quelques jours, je vais apprendre &agrave; cuisiner lors d&rsquo;un cours un peu particulier, pour servir un restaurant plein lors d&rsquo;un service de 30 convives. Et cerise sur le g&acirc;teau, ce cours de cuisine est pour l&#39;instant&hellip; gratuit&nbsp;!<br />\r\n&nbsp;<br />\r\nEn revanche, cuisiner pour des inconnus, &ccedil;a me fait peur. Je m&rsquo;assure donc que mes amis et ma famille viennent m&rsquo;encourager en r&eacute;servant une table lors de ma prestation. Je cherche une recette &agrave; la fois originale, mais aussi qui puisse plaire au plus grand nombre&nbsp;; Ce sera du magret de canard aux pralines roses. Et puis j&rsquo;appelle le chef pour un briefing pr&eacute;paratoire. &nbsp;Et l&agrave; je suis rassur&eacute;&nbsp;: le chef va commander les bons ingr&eacute;dients, me convier dans sa cuisine 5 heures avant le service pour avoir plus de temps qu&rsquo;il ne faut pour la mise en place, et me dit que c&rsquo;est lui qui va contr&ocirc;ler la cuisson des plats et l&rsquo;envoi des assiettes. En somme, je plonge dans le grand bain, mais j&rsquo;ai des bou&eacute;es de sauvetage tout autour de moi ! ;-)<br />\r\n&nbsp;<br />\r\nLe jour J arrive&nbsp;: je rejoins le chef dans sa cuisine, avec les autres cuisiniers amateurs&nbsp;: Fabien cuisine l&rsquo;entr&eacute;e, Elodie le dessert. L&rsquo;ambiance est tout de suite d&eacute;contract&eacute;e, bonne enfant, voire potache car petit &agrave; petit les langues se d&eacute;lient et les plaisanteries fusent.&nbsp; Ce qui n&rsquo;emp&ecirc;che pas le travail d&rsquo;avancer, puisque vers 18h l&rsquo;ensemble du menu est quasi pr&ecirc;t, gr&acirc;ce au coaching de notre chef qui nous guide pour que nous soyons efficaces, tout en surveillant si nos recettes sont bien ex&eacute;cut&eacute;es, et en nous donnant quelques conseils pour les am&eacute;liorer par rapport &agrave; ce que nous savons faire. Il reste maintenant &agrave; peaufiner les &eacute;l&eacute;ments de dressage des assiettes&nbsp;: nous nous entrainons avec le chef qui nous donne ses astuces sur une assiette de test que chacun lui pr&eacute;sente. A 19h tout est termin&eacute;, le chef nous aide &agrave; nous organiser pour le coup de feu qui approche. Nous avons quelques dizaines de minutes pour souffler, reprendre des forces, manger un morceau et m&ecirc;me boire un petit ap&eacute;ro en &eacute;quipe&nbsp;!<br />\r\n&nbsp;<br />\r\n20h30&nbsp;: le coup de feu d&eacute;marre. Les clients sont install&eacute;s, prennent des ap&eacute;ritifs, et le chef commence &agrave; envoyer ses mises en bouche&nbsp;; les bons de commande arrivent en cuisine et nous indiquent la composition des tables et l&rsquo;ordre dans lequel nous allons envoyer nos assiettes en salle. La pression monte, mais le chef est tellement calme que nous sommes sereins. Et puis les cuisiniers amateurs s&rsquo;entraident, alors on peut presque dire que c&rsquo;est &hellip; facile&nbsp;! En tous cas beaucoup plus facile que ce que nous pensions. Mais le coup de feu, c&rsquo;est le coup de feu, les assiettes s&rsquo;encha&icirc;nent, toutes les op&eacute;rations de dressage sont r&eacute;alis&eacute;es pour que tout soit beau, et bon. Fabien termine de servir les entr&eacute;es, et se dirige vers la salle avec les deux derni&egrave;res assiettes&nbsp;: une salve d&rsquo;applaudissement retentit, une belle r&eacute;compense, j&rsquo;esp&egrave;re avoir la m&ecirc;me&nbsp;! Puis les premi&egrave;res assiettes de magret partent en salle, tout s&rsquo;encha&icirc;ne assez vite. Je suis moi aussi applaudit, puis vient le tour d&rsquo;Elodie.<br />\r\n&nbsp;<br />\r\nA la fin du service, tout le monde se retrouve en salle sous le regard bienveillant de notre public qui a go&ucirc;t&eacute;, et not&eacute; nos r&eacute;alisations. La tension est redescendue, je commence &agrave; me dire que ce que je viens de vivre &eacute;tait excitant, enrichissant, dr&ocirc;le, convivial, bref, c&rsquo;&eacute;tait &laquo;&nbsp;trop bien&nbsp;&raquo;&nbsp;!<br />\r\n&nbsp;<br />\r\nJe pense que mes appr&eacute;hensions initiales &eacute;taient naturelles, mais au final non justifi&eacute;es. Tout s&rsquo;est bien pass&eacute; parce que le chef Sylvain est un grand professionnel, p&eacute;dagogue et sympathique, &nbsp;il &eacute;tait l&agrave; pour tout mener en v&eacute;ritable chef d&rsquo;orchestre. Et depuis j&rsquo;attends avec impatience le prochain &eacute;v&eacute;nement Food&amp;You o&ugrave; je vais pouvoir &agrave; nouveau jouer au chef le temps d&rsquo;un soir &hellip;&nbsp;!<br />\r\n&nbsp;', 1, 1, '2016-03-12 17:22:22', '2016-05-24 15:47:53', 'Mon exprience en tant que cuisinier amateur...', 'cuisinier, sortir, lyon, insolite, cours de cuisine, amateur, restaurant, cuisiner, gastronomie', 224),
(4, 3, 457, 'Chef cuisinier d''une soire. Tmoignage de Audrey R, La plume d''Adam.', 'chef-cuisinier-d-une-soiree-temoignage-de-audrey-r-la-plume-d-adam', '<p>Il n&#39;y a pas longtemps j&#39;ai v&eacute;cu une exp&eacute;rience innovante: l&#39;aventure Food and You.Le concept est simple:<br />\r\nTrois participants sont s&eacute;lectionn&eacute;s,<br />\r\nUn dessert, un plat, une entr&eacute;e,<br />\r\nLe but, aid&eacute; d&#39;un Chef, r&eacute;aliser dans les cuisines d&#39;un restaurant la recette qu&#39;ils ont propos&eacute;.<br />\r\nPour ma part j&#39;ai pr&eacute;f&eacute;r&eacute; faire travailler mon palais c&ocirc;t&eacute; salle que mes bras c&ocirc;t&eacute; cuisine cette fois.<br />\r\nChez Augusto le rendez-vous &eacute;tait donn&eacute;.<br />\r\nL&#39;organisation des tables est bien pens&eacute;e.<br />\r\nVous pouvez choisir l&#39;intimit&eacute; d&#39;un t&ecirc;te-&agrave;-t&ecirc;te ou la convivialit&eacute; d&#39;&ecirc;tre m&eacute;lang&eacute;.<br />\r\nPeu apr&egrave;s avoir rejoint notre table, un magn&eacute;to s&#39;est mit &agrave; fonctionner.<br />\r\nLa pr&eacute;sentation de l&#39;entr&eacute;e &eacute;nonc&eacute;e,<br />\r\nL&#39;exp&eacute;rience Food and You pouvait commencer.<br />\r\nEt je vis arriver une assiette digne d&#39;un chef.<br />\r\nBien dessin&eacute;e, une pur&eacute;e de c&eacute;leri d&eacute;cor&eacute;e de l&eacute;gumes croquants, b&oelig;uf gravlax et vinaigrette &agrave; la mangue.<br />\r\nS&#39;ensuit un d&eacute;licieux risotto Terre-Mer.<br />\r\nEt pour finir un tiramisu revisit&eacute; fa&ccedil;on poire Belle-H&eacute;l&egrave;ne.<br />\r\nJe fus impressionn&eacute;e par la qualit&eacute; des plats propos&eacute;s et par le talent des participants.<br />\r\nJ&#39;ai aim&eacute; :<br />\r\n- La convivialit&eacute; de ce moment partag&eacute;.<br />\r\nEtre plac&eacute;e &agrave; une table, rencontrer des gourmets, &eacute;changer sur le sujet et s&#39;amuser.<br />\r\n- Voir la fiert&eacute; des participants devant leurs amis, parents.<br />\r\nMontrer leur cr&eacute;ativit&eacute; et leur talent aux commandes d&#39;un restaurant.<br />\r\n- Rencontrer le Chef Augusto.<br />\r\nPour sa p&eacute;dagogie et la passion qu&#39;il v&eacute;hicule de son m&eacute;tier.<br />\r\nJe vous invite &agrave; vivre l&#39;exp&eacute;rience Food and You.<br />\r\nEt qui sait, il se pourrait qu&#39;un jour je quitte ma zone de confort pour tenter de satisfaire vos palais.</p>\r\n\r\n<p><strong><em>Audrey R, La plume d&#39;Adam </em></strong><br />\r\n<a href="http://laplumedadam.com/"><em>laplumedadam.com', '<p>Il n&#39;y a pas longtemps j&#39;ai v&eacute;cu une exp&eacute;rience innovante: l&#39;aventure Food and You.Le concept est simple:<br />\r\nTrois participants sont s&eacute;lectionn&eacute;s,<br />\r\nUn dessert, un plat, une entr&eacute;e,<br />\r\nLe but, aid&eacute; d&#39;un Chef, r&eacute;aliser dans les cuisines d&#39;un restaurant la recette qu&#39;ils ont propos&eacute;.<br />\r\nPour ma part j&#39;ai pr&eacute;f&eacute;r&eacute; faire travailler mon palais c&ocirc;t&eacute; salle que mes bras c&ocirc;t&eacute; cuisine cette fois.<br />\r\nChez Augusto le rendez-vous &eacute;tait donn&eacute;.<br />\r\nL&#39;organisation des tables est bien pens&eacute;e.<br />\r\nVous pouvez choisir l&#39;intimit&eacute; d&#39;un t&ecirc;te-&agrave;-t&ecirc;te ou la convivialit&eacute; d&#39;&ecirc;tre m&eacute;lang&eacute;.<br />\r\nPeu apr&egrave;s avoir rejoint notre table, un magn&eacute;to s&#39;est mit &agrave; fonctionner.<br />\r\nLa pr&eacute;sentation de l&#39;entr&eacute;e &eacute;nonc&eacute;e,<br />\r\nL&#39;exp&eacute;rience Food and You pouvait commencer.<br />\r\nEt je vis arriver une assiette digne d&#39;un chef.<br />\r\nBien dessin&eacute;e, une pur&eacute;e de c&eacute;leri d&eacute;cor&eacute;e de l&eacute;gumes croquants, b&oelig;uf gravlax et vinaigrette &agrave; la mangue.<br />\r\nS&#39;ensuit un d&eacute;licieux risotto Terre-Mer.<br />\r\nEt pour finir un tiramisu revisit&eacute; fa&ccedil;on poire Belle-H&eacute;l&egrave;ne.<br />\r\nJe fus impressionn&eacute;e par la qualit&eacute; des plats propos&eacute;s et par le talent des participants.<br />\r\nJ&#39;ai aim&eacute; :<br />\r\n- La convivialit&eacute; de ce moment partag&eacute;.<br />\r\nEtre plac&eacute;e &agrave; une table, rencontrer des gourmets, &eacute;changer sur le sujet et s&#39;amuser.<br />\r\n- Voir la fiert&eacute; des participants devant leurs amis, parents.<br />\r\nMontrer leur cr&eacute;ativit&eacute; et leur talent aux commandes d&#39;un restaurant.<br />\r\n- Rencontrer le Chef Augusto.<br />\r\nPour sa p&eacute;dagogie et la passion qu&#39;il v&eacute;hicule de son m&eacute;tier.<br />\r\nJe vous invite &agrave; vivre l&#39;exp&eacute;rience Food and You.<br />\r\nEt qui sait, il se pourrait qu&#39;un jour je quitte ma zone de confort pour tenter de satisfaire vos palais.</p>\r\n\r\n<p><strong><em>Audrey R, La plume d&#39;Adam </em></strong><br />\r\n<a href="http://laplumedadam.com/"><em>laplumedadam.com<!--more--></em></a></p>', 1, 1, '2016-04-19 13:22:44', '2016-05-24 15:57:53', 'Temoignage d''un chef amateur qui aime cuisiner chez food and you', 'restaurant, cuisiner, chef, gastronomie, temoignage, augusto, concours, insolite, recette, lyon, plume d''adam,', 85);
