(24, 25, 79, 'Audrey', 'BERTHEAS', 'audrey', '1981-07-11', 'Adepte des produits surgels et de la cuisine toute prte il y a encore 3 ans, je participe  des ateliers de cuisine dans le cadre d''tudes marketing. Et l, c''est la rvlation !! Ma passion, notamment pour la ptisserie se dveloppe de jour en jour, les livres de cuisines ont envahi mon appartement (la cuisine n''tant plus assez grande). Et tout mon entourage (famille, amis et collgues de bureau) est ravi de tester au quotidien mes nouvelles crations !!', 'Impossible de me dcider entre le mille feuille  la provenale, le cheesecake citron/fraises, les lasagnes saumon/chvre ou encore la tarte sable fine aux pommes....', 'FY3f1bcb10', 3.25, '06 67 96 80 25', 1, 1, NULL),
