(38, 43, 81, 'Florence', 'DESSAGNE', 'florence', '1974-12-22', 'Propritaire d''un restaurant bar trs rput sur la place Lyonnaise, il y a quelques annes. Suis revenue  mes premires amours : La communication mais spcialise dans l''Art de Vivre. La patronne  l''Horloge mais pas derrire les fourneaux, cette fois je veux dfier mes anciens chefs ;-) Le dfi va tre hardu mais je le relve. Go ! Mme si j''ai plus l''habitude d''tre au resto que dans ma cuisine.', 'Le chili con carne pour les amis', 'FY1535bde0', 4, '06 62 80 70 76', 1, 1, NULL),
(39, 44, 80, 'Fafa', 'Buleuse', 'fafa', NULL, 'Passionne par l''Humain, j''ai volu pendant plus de 10 ans en Ressources Humaines et Communication interne au sein de grands groupes; Communicante dans l''me et aimant relever les dfis, j''ai cr mon agence de communication "100% art de vivre" en 2015 grce  une belle rencontre.\r\nEnfin, picurienne depuis toujours, j''aime cuisiner pour rgaler ma famille et mes amis.', 'La fondue savoyarde pour mes amis', 'FY3d0357b3', 4, '06/83/83/13/28', 1, 1, NULL),
