(96, 107, 130, 'Ryma', 'PROST-ROMAND', 'ryma', '1965-02-05', 'Voil prs d''un demi sicle que je gote  tout, je suis gourmande et passionne d''pices. Mes voyages se passent dans les cuisines des autres. J''aime y tre invite et partager la prparation des mets. Chaque cuistot est diffrent dans sa faon de s''organiser, de laisser libre court  son imagination ou d''appliquer des techniques. Mre de trois enfants et salarie  temps complet j''ai toujours tout prpar et  cuisin au rythme des saisons. Les vacances sont synonymes de grande table, de cinq convives nous passons facilement   quinze. Le point commun, c''est l''accueil et la simplicit. Durant l''t c''est cuisine du frigo, nous ne perdons jamais rien et recyclons tout. Nous cuisinons dans des lieux peu confortables et nous imaginons mme des recettes de pain dans levain si le boulanger ne passe pas au village. J''aime les rencontres en cuisine , les pices qui rveillent, la crme qui caresse, le vin qui rvle,...', 'Boulettes de viande facon tajine en sauce tomates aromatis au thym accompagn d''une pure de pommes de terre rhausse d''olives concasses.', 'FY30e66e46', 0, '06 40 58 87 71', 0, 0, 'consultante en formation, j''essaye de courir et je cuisine'),
