(107, 118, NULL, 'Damien', 'VEAU', 'damien', '1984-08-08', 'Pendant mes tudes de chimiste, nous avions une blague rcurrente pour expliquer notre art aux non-initis : "C''est comme de la cuisine, mais on n''a pas le droit de lcher la cuiller." Il est donc naturel que le chimiste s''panouisse galement en cuisine pour laisser s''panouir son meilleur pch : la gourmandise.\r\nLa chimie a galement pris possession de mes loisirs  travers le brassage de bire en amateur. laboration de nouvelles recettes, extraction de sucres et raction de Maillard puis fermentation et maturation passionnent ma partie scientifique tandis que les odeurs du malt chaud et du houblon ainsi que la dgustation mettent en moi le gourmand.', 'Saut de filet mignon sauce miso et son riz coco', 'FYe76a0321', NULL, '06 85 32 91 48', 0, 0, 'pas bavard avant le petit dej'),
