(176, 209, 288, 'Elodie', 'Sanches Rafaralahy', 'elodie', NULL, 'Je fonds  l''ide de partager ce plaisir de la cuisine avec des professionnels. Je n''en suis pas une moi-mme, mais ne vous inquitez pas, je ferai de mon mieux! Je pense tout de mme avoir du bol de pouvoir enfin voir comment se passe un service en cuisine. Je ne dirai pas que j''en rvais mais presque :)\r\nNous aurons tous du pain sur la planche ce soir-l pour le plus grand bonheur de vos petits bidons!', 'Ballottines de poulet au chorizo et mozzarella', 'FY82e89bc9', NULL, '06 10 72 93 94', 0, 0, 'Une maman dborde :)'),
