(188, 221, 274, 'Cllia', 'Aillc', 'clelia', NULL, 'Manger, manger et manger ! Voila mon let'' motiv.\r\nEn grande curieuse, j''ai toujours envie de tester de nouvelles saveurs, rien ne m''arrte. Ne le dites  personne mais  j''ai mme dj essay les insectes (GLOUPS), histoire de ne pas mourir idiote. \r\nDans un style un peu plus gourmand, je suis dingue de la cuisine au th matcha. Plus globalement, les influences asiatiques ont le don de me faire chavirer. Je ne peux pas rsister  un panier fumant de dim sum. Et mon voyage rcent en Chine n''a pas arrang les choses. ;)\r\nSerial testeuse de restaurants, vous retrouverez mes coups de coeur sur mon blog Rvlations gourmandes (garanti sans insecte..ou presque ;) ).', 'Tellement curieuse que je refais rarement un plat. L''appel de la nouveaut est trop fort !', 'FYcd1955b7', 3.9375, '06 35 58 08 11', 1, 1, 'Dans la communication digitale'),
(189, 222, 276, 'Emilie', 'Van Dommele', 'emilie-1', NULL, 'Vorace, ttue, gourmande, passionne. Mon intrt pour la cuisine et tout ce qui se mange remonte  des souvenirs trs lointains, des vacances en Dordogne,  Rocamadour en passant par les caves de Beaunes. Ajout  cela pas mal de temps pass au Canada et aux USA. A chaque fois nos valises taient remplies de mets divins et aussi de bouquins de cuisine. Chauvine j''avoue un faible pour la cuisine franaise et aussi pour les gros desserts amricains. Pas sectaire pour un sous , j''aime aussi bien les gastronomiques que la street food. Le plus important c''est de se rgaler. Sur cinnamonandcake, tu trouveras plein de recettes gourmandes et d''endroits sympas pour becqueter.', 'Pas de signature, mon ct vorace me pousse  toujours tester des nouveaux trucs.', 'FY68bc8a03', 3.75, '06 66 04 98 62', 1, 1, 'Mangeuse confirme'),
