(254, 314, 378, 'Maud', 'Boyer', 'maud', '1995-03-27', 'Federico Fellini ha detto "la vita  una combinazione di magia et pasta".\r\n\r\nAucune citation ne saurait coller davantage  mon tat d''esprit !\r\n\r\nD''origine italienne, j''ai grandi dans un environnement qui m''a conduite  apprcier l''art de la table ds ma plus tendre enfance.\r\n\r\nVritable picurienne, j''aime dcouvrir de nouvelles saveurs et laborer des recettes  base de produits sains et savoureux. La cuisine reprsente pour moi un moment de partage unique au cours duquel je tente au mieux de ravir mes convives. Ma plus grande satisfaction rside dans leurs sourires aprs un bon repas !\r\n\r\nDe plus, je crois profondment que la bonne gastronomie n''a besoin d''aucun artifice c''est pourquoi j''affectionne les recettes simples qui conservent des gots authentiques et (trs) gourmands !', 'Risotto ai funghi', 'FY32dd6611', NULL, '06 63 03 78 61', 0, 0, 'Etudiante en droit (et grande gourmande)'),
