(275, 336, 586, 'Nicolas', 'Montagard', 'nicolas-2', '1984-08-28', '1er Job d''adolescent : aide boulanger\r\n2me job d''ado : plongeur puis commis entres / desserts\r\n1er Job tudiant : production / Boulangerie PAUL\r\n2me Job tudiant : production / McDONALD\r\n\r\nBon ! En vrai cette passion pour la cuisine me vient, non pas de mes petites expriences, plutt de mon cher PAPA qui  toujours prpar nos plats, de mon intrt pour les bons produits, les saveurs raffines, et la sant par l''alimentation.\r\n\r\nJ''ai donc,  l''image du Papa, commenc  cuisiner tous mes repas ds que j''ai commenc  vivre seul. En 10 ans j''ai appris seul, avec mon imagination, avec des souvenirs, avec des cours rel ou sur le internet, ou  ttonnant pour reproduire des recette que j''ai got dans des restaurants.', 'Roul de volaille forestier', 'FY57049e36', NULL, NULL, 0, 0, 'Consultant-Formateur en Informatique'),
(276, 337, 423, 'Odile', 'Beneteau', 'odile', NULL, NULL, NULL, 'FY153456d3', NULL, NULL, 0, 0, NULL),
