(278, 339, 430, 'Mlodie', 'Masset', 'melodie', NULL, ' CON ENERGIA !\r\n\r\nNombreux(ses) sont les passionn(e)s de cuisine qui ont d''abord cultiv ce plaisir en famille avant que cela devienne une histoire personnelle. Mon histoire en fait partie! Avec patience, poigne, et vitalit, je vous livre son secret...\r\n\r\nTout a commenc il y a fort longtemps  San Giuseppe dans la province de Frosinone. C''est un petit village situ au sud de Rome. Il est rput pour ses relents culinaires qui suscitent l''apptit des gourmands du monde entier. Nous citerons le fameux fromage Pecorino spcialit de l-bas...\r\n\r\nDans une maison tout en pierre vivait Mamie Concetta. Avec toute la famille et les voisins le quotidien se concentrait autour du travail des terres agricoles. Les femmes concoctaient ensemble une cuisine familiale riche et gnreuse dote dingrdients frachement cueillis. Imaginez ce four  pierre qui offre une cuisson sans pareil! Berce par les phrases chantantes en patois Italien de  La nonna  puis de  la mama , enfant, je m''endormais au cur des milles et uns parfums fruits, sals et sucrs. Rves de figuiers et de citronnier... Le lendemain les repas en famille frmissaient d''amour autant que les plats tout juste sortis du four. Entre deux plats, confidences chuchotes dans la cuisine de la nonna, "assaggiarlo y cosi" (gotes-moi a)\r\n\r\nAujourd''hui,  Lyon, la cuisine de Mamie Concetta s''est expatrie et la famille aussi. J''ai perptu ses recettes en les revisitant pour  son tour runir les Lyonnais autour de surprises apptissantes. Aprs s''tre quipe d''une cuisine aussi spacieuse que chaleureuse, J''ai dot ses surfaces aussi blanches que la mozzarella de casseroles qui sonnent comme le "Bella Ciao" de Mamie Concetta!\r\nMama mia! Attablez-vous, canalisez vos cinq sens en bullition!\r\nAccompagne par mamie Concetta et la mamma, aprs un petit tour au march de la Croix Rousse Mlodie aux fourneaux s''apprte  vous servir votre repas...\r\n\r\nPartagez un voyage  travers une multitude de souvenirs que je vais vous concocter. Convivialit et fous rires sont au rendez-vous de mes repas, Je souhaite qu''ils fassent aussi partie des vtres.\r\n\r\nVoil quelques cuilleres qui vous laissent entendre le synopsis, l''avant propos, l''dito de ma cuisine et qui vous donneront probablement envie d''en reprendre un peu!\r\n\r\nCiao', 'Le tiramisu revisit', 'FY45aba57d', NULL, '06 33 24 98 71', 0, 0, 'Hyppie chic gourmande  200  l''heure'),
