(297, 371, 488, 'Beatrice', 'MODERNE', 'beatrice', '1965-10-20', 'Bonjour, je suis Beatrice, votre chef cuisinier d''une soire. Passionne par la cuisine j''adore recevoir des ami-e-s et leur concocter de nouveaux petits plats. Pour moi cuisiner est un acte de partage, d''amiti, de convivialit, d''amour...La qualit des produits est importante, je privilgie les produits issus de l''agriculture Bio ou raisonne, les producteurs locaux. Derrire chacun d''eux, il y a des hommes et des femmes, il y a une histoire.', 'Venez le dcouvrir, mercredi 27 avril au restaurant Le Plato  la croix-Rousse (Lyon 4me)', 'FY4c15aeef', 0, NULL, 0, 0, 'Maman de 6 enfants, la cuisine est au coeur de ma vie.'),
