(299, 373, 628, 'Virginie', 'BOUVARD', 'virginie-1', '1975-02-07', 'Que dire dautre si ce nest que je suis une fille, que j''ai travaill aux achats dans le domaine de la dcoration. J''aime osciller entre donuts  la framboise, Stephen King, Tim Burton, bonbons qui piquent, Nan Goldin, Bad Taste et Toy Story \r\nDaussi loin que je men souvienne ce surnom de Cloporte a toujours t le mien. Il me rsume finalement assez bien et jassume totalement cet aspect de ma personnalit. Le Cloporte est une espce de crustac prsentant une coquille grise assez dure, oui, cest ce petit isopode que vous trouvez sous les cailloux qui se recroqueville quand on le touche. Aprs un certain temps et beaucoup de calme, le Cloporte souvre  nouveau et peut mme parfois grimper dans le creux de votre main.', 'Tout ce qui contient du sucre et des fruits de la passion', 'FY876230cd', NULL, '0681711286', 0, 0, 'CM, Photographe et couteau suisse freelance'),
