(342, 417, 560, 'Manon', 'Zt', 'manon-1', NULL, 'Passionne de cuisine, je suis toujours  la recherche de nouvelles saveurs et associations. Certes il y a parfois des loups... mais c''est meilleur aprs quelques tentatives !\r\n\r\nJe suis yelpeuse lite  Lyon,  je teste donc de nombreux restaurants, salons de th...', 'Je n''ai pas de plats signatures particuliers, j''aime autant cuisiner sal que sucr. \r\n\r\nSal : Risotto\r\nSucr : Layer cake', 'FY0b51da1e', NULL, '0662944546', 0, 0, 'Dynamique'),
(343, 418, 588, 'Sophia', 'Yelp', 'sophia', '1990-01-01', 'Jai une double culture asiatique/ franais, et jadore voyager. Je considre la cuisine la meilleur faon pour connaitre le monde. C''est pour a Jaime raliser ou revisiter les plats classiques franais, les incontournable plats asiatiqe, ou les inspirs de mes voyages !\r\n\r\nJaime les produits frais, et des pices, des pices du monde entier.', 'tonkatsu, bibimbap, ou tiramisu au matcha', 'FY63fc5246', NULL, '0666506700', 0, 0, 'Yelpeuse'),
