(346, 421, 572, 'Nicolas', 'Carrier', 'nicolas-3', '1988-08-10', 'Pass par les cuisines d''un restaurant tant tudiant, j''ai pourtant refus cette voix avec aujourd''hui un grand dsir d''y revenir ! Bien plus qu''une passion pour moi, je suis celui que l''on colle aux fourneaux durant les soire (et que a soit pour le shaker ou les casseroles...).\r\n\r\nUn grand amour de la cuisine qui me pousse a toutes les curiosit et parfois mme a manger des trucs particulirement affreux. Mais qui sait ou les bonnes surprises se cachent ?!\r\n\r\nPeut tre que le temps d''un soir je peux vous faire partager mon univers ? Une cuisine avec des produits simples et de saisons. Toujours trs assaisonn, inspir de la street food pas toujours clean des choppes du bord de route... Ce soir on va voyager !', 'Brochettes de viandes marines, sauces d''inspirations asiatiques,\r\nServies dans des galettes couvertes d''aromates.', 'FY9434a2ef', NULL, '(((', 0, 0, 'Un bureaucrate qui a normment d''nergie  revendre.'),
