(381, 457, 614, 'Justine', 'DEGRANDI', 'justine', '1987-10-24', 'Dans ma famille, on a toujours partag la passion du  bien manger , jai donc toujours baigner dans un environnement gourmand ! Mes amis pourraient vous le dire, au quotidien, je ne parle que de cuisine   jaime beaucoup recevoir et surprendre mes convives alors je suis toujours  la recherche de nouvelles recettes !  Je suis galement Rdactrice FOOD pour le blog "Talons Aiguilles et Running Shoes" !\r\nD''origine italienne et ayant vcu l-bas quelques mois, venir cuisiner avec Lello sera un vrai bonheur :)', 'Pasta al limone', 'FYd7e1288d', NULL, '0786100236', 0, 0, 'Passionne de cuisine'),
