INSERT INTO `recipe` (`id`, `member_id`, `photo_id`, `name`, `type`, `public_description`, `private_description`) VALUES
(1, 24, 47, 'Quand le Tiramisu rencontre la Belle Hlne...', '2dessert', 'Revisite du tiramisu avec une association poire/chocolat et un biscuit sabl breton', 'volont de conserver les lments de vase du tiramisu : une crme au mascarpone, un biscuit et une sauce mais en associant des saveurs diffrentes du traditionnel caf.\r\nLa crme au mascarpone est vanille et se mlange  une brunoise de poires (lgrement caramlises  la pole). Un coulis chocolat vient remplacer le caf et le biscuit est un sabl breton dont la texture devient fondante avec le mlange.'),
(2, 28, 50, 'Salade chvre chaud et miel', '0entry', 'Salade de chvre chaud', 'Salade, chvre, toast, miel'),
(4, 22, 56, 'sushi', '0entry', 'saumon riz', 'sushi saumon'),
(5, 22, 57, 'maki', '0entry', 'makis', 'maki'),
(6, 27, 58, 'Gravelax de boeuf et lgumes croquants', '0entry', 'filet de boeuf mi cuit au sel et aromate\r\nquelques lgumes croquants, pure de cleri \r\nchips de parmesan\r\nvinaigrette  la mangue pour relev tout a', 'Ingrdients\r\n\r\n500 g de filet de Buf\r\n1 gousse dail\r\n50 g de sucre\r\n100 g de gros sel\r\n5 g de gingembre \r\n\r\n1 carotte violette\r\n1 chou romanesco\r\n1botte dasperge\r\n1 oignon rouge\r\n10g de beurre\r\n10g de sucre\r\n\r\n1 Mangue\r\n1 citron vert\r\n1 cuillre  soupe de vinaigre de cidre\r\n2 cuillres  soupe dhuile dolive\r\n\r\n100 g de parmesan\r\n\r\nGravlax de buf\r\n\r\nPelez lail et le gingembre et lcrasez.\r\nDans une boite hermtique, mettez le gros sel, le sucre  le gingembre, lail, le buf.\r\nLaissez 24 au rfrigrateur en retournant la boite de temps en temps.\r\n\r\nLes Lgumes\r\nNettoyez les lgumes.\r\nRcuprez quelques inflorescences de chou romanesco.\r\nTaillez des lamelles de carotte.\r\nFaites fondre le beurre dans une casserole, mettez le choux,mouillez  hauteur les lgumes, ajoutez une cuillre  caf de sucre, mettez un disque de papier sulfuris et faites cuire 10 minutes.\r\nFaire de mme avec les carottes dans une autre casserole.\r\nTaillez de fines lamelles doignon rouge.\r\n\r\nVinaigrette  la mangue.\r\n\r\nDcortiquez 1 mangue.\r\nPassez la mangue dcortique au mixeur, avec le jus d1/2 citron vert et 1 cuillre  soupe de vinaigre de cidre.\r\nMontez ensuite cette vinaigrette en incorporant 2 cuillre  soupe dhuile dolive, sans cesser de mixer.\r\n\r\n\r\nTuile de Parmesan\r\n\r\nFaites chauffer le four  180C\r\nEtalez une mince couche de parmesan sur une feuille de papier cuisson\r\nMettre au four 7mn en surveillant la coloration.\r\nTaillez vos chips  lemporte pice\r\n\r\nDressage\r\n\r\nPlacez la vinaigrette\r\nTaillez de fine tranche de Gravlax et les enroulez\r\nSur la vinaigrette, intercalez  les diffrents lments.'),
(7, 27, 59, 'Gravelax de boeuf et lgumes croquants', '0entry', 'Filet de boeuf mi-cuit au sel et aromates\r\nLgumes croquants, pure de celeri\r\nchips de parmesan\r\nvinaigrette  la mangue pour releve tout a', 'Ingrdients\r\n\r\n500 g de filet de Buf\r\n1 gousse dail\r\n50 g de sucre\r\n100 g de gros sel\r\n5 g de gingembre \r\n\r\n1 carotte violette\r\n1 chou romanesco\r\n1botte dasperge\r\n1 oignon rouge\r\n10g de beurre\r\n10g de sucre\r\n\r\n1 Mangue\r\n1 citron vert\r\n1 cuillre  soupe de vinaigre de cidre\r\n2 cuillres  soupe dhuile dolive\r\n\r\n100 g de parmesan\r\n\r\nGravlax de buf\r\n\r\nPelez lail et le gingembre et lcrasez.\r\nDans une boite hermtique, mettez le gros sel, le sucre  le gingembre, lail, le buf.\r\nLaissez 24 au rfrigrateur en retournant la boite de temps en temps.\r\n\r\nLes Lgumes\r\nNettoyez les lgumes.\r\nRcuprez quelques inflorescences de chou romanesco.\r\nTaillez des lamelles de carotte.\r\nFaites fondre le beurre dans une casserole, mettez le choux, mouillez  hauteur les lgumes, ajoutez une cuillre  caf de sucre, mettez un disque de papier sulfuris et faites cuire 10 minutes.\r\nFaire de mme avec les carottes dans une autre casserole.\r\nTaillez de fines lamelles doignon rouge.\r\n\r\nVinaigrette  la mangue.\r\n\r\nDcortiquez 1 mangue.\r\nPassez la mangue dcortique au mixeur, avec le jus d1/2 citron vert et 1 cuillre  soupe de vinaigre de cidre.\r\nMontez ensuite cette vinaigrette en incorporant 2 cuillre  soupe dhuile dolive, sans cesser de mixer.\r\n\r\n\r\nTuile de Parmesan\r\n\r\nFaites chauffer le four  180C\r\nEtalez une mince couche de parmesan sur une feuille de papier cuisson\r\nMettre au four 7mn en surveillant la coloration.\r\nTaillez vos chips  lemporte pice\r\n\r\nDressage\r\n\r\nPlacez la vinaigrette\r\nTaillez de fine tranche de Gravlax et les enroulez\r\nSur la vinaigrette, intercalez  les diffrents lments.\r\nParsemer quelques noisettes torfies'),
(8, 24, 77, 'Quand le Tiramisu rencontre la Belle Hlne', '2dessert', 'Tiramisu revisit avec une association poire/chocolat et un sabl breton', 'Volont de revisiter le tiramisu en gardant les lments (biscuit, crme, sauce) mais en changeant les saveurs : je conserve la crme mascarpone (vanille) que j''associe  une brunoise de poires (lgrement caramlises  la pole) sur un sabl breton (qui devient fondant avec la crme) et un coulis de chocolat ( la place du caf).'),
(9, 24, 62, 'Quand le Tiramisu rencontre la Belle Hlne', '2dessert', 'Tiramisu revisit avec une association poire/chocolat et un sabl breton', 'Volont de revisiter le tiramisu en gardant les lments (biscuit, crme, sauce) mais en changeant les saveurs : je conserve la crme mascarpone (vanille) que j''associe  une brunoise de poires (lgrement caramlises  la pole) sur un sabl breton (qui devient fondant avec la crme) et un coulis de chocolat ( la place du caf).'),
(10, 14, 63, 'Cuisse de pintade au combava en cromesquis, velout de polenta  la vanille et billes croustillantes pices', '0entry', 'Petit beignet de pintade au combava sur un lit de polenta trs crmeuse  la vanille. Billes vertes croustillantes fourres et pices.', 'Cuisse de pintade dsosses et prpares en faon "farce mousseline" pour en faire des cromesquis, prsents sur l''os de pintade (comme si c''tait la cuisse elle-mme).\r\nPolenta en velout agrmente de vanille.\r\nBilles croustillantes de persillade, remplie d''une crme de tomate vinaigre et pice.'),
(11, 14, 64, 'Cuisse de pintade au combava en cromesquis, velout de polenta  la vanille et billes croustillantes pices', '0entry', 'Petit beignet de pintade au combava sur un lit de polenta trs crmeuse  la vanille. Billes vertes croustillantes fourres et pices.', 'Cuisse de pintade dsosses et prpares en faon "farce mousseline" pour en faire des cromesquis, prsents sur l''os de pintade (comme si c''tait la cuisse elle-mme).\r\nPolenta en velout agrmente de vanille.\r\nBilles croustillantes de persillade, remplie d''une crme de tomate vinaigre et pice.'),
(12, 14, 65, 'Cuisse de pintade au combava en cromesquis, velout de polenta  la vanille et billes croustillantes pices', '0entry', 'Petit beignet de pintade au combava sur un lit de polenta trs crmeuse  la vanille. Billes vertes croustillantes fourres et pices.', 'Cuisse de pintade dsosses et prpares en faon "farce mousseline" pour en faire des cromesquis, prsents sur l''os de pintade (comme si c''tait la cuisse elle-mme).\r\nPolenta en velout agrmente de vanille.\r\nBilles croustillantes de persillade, remplie d''une crme de tomate vinaigre et pice.'),
(13, 14, 66, 'ufs de caille  la tomate sur velout de riz au safran', '0entry', 'Tout est dans le titre !', 'ufs de caille durs, cuisins  la tomate et gingembre (faon runionnaise). Velout de riz au safran. Tomates cerises caramlises. Oignons rouges et petites penses violettes comestibles.'),
(14, 25, 75, 'Risotto Ter Mer', '1main', 'Le poisson repose sur un lit de risotto aromatis  la bouillabaisse, avec ses petites tuiles croquantes chorizo et parmesan', 'Risotto de St Pierre ou de Barbu (selon arrivage)\r\nLe bouillon du Risotto est fait avec un fond de poisson (carcasse du poisson, tomates, concentr de tomate, oignons, ail, chalotes, vin blanc,sel et poivre)\r\nInfusion de feuilles de cerfeuil dans le bouillon avant son utilisation.\r\nAu dernier moment, j''ajoute crme frache, parmesan et quelques anneaux de calamars.\r\nUne petite tuile parmesan/cerfeuil\r\nUne chips de chorizo (ce n''est pas trs italien...)\r\nUne sauce, crme chorizo (possible de faire en espuma)'),
(15, 38, 83, 'Pavlova faon pina colada', '2dessert', 'Pavolva (meringue - chantilly)  l''ananas et noix de coco', 'Pavolva (meringue - chantilly)  l''ananas et noix de coco'),
(16, 23, 538, 'Tartare Di Cabras', '0entry', 'Tartare Di Cabras', 'Tartare di Cabras\r\n\r\nQuantits pour pour 6 personnes / galette de poids chiches :\r\n100g de farine de poids chiche\r\n3g de sel\r\n1g Poivre\r\n200g d''eau\r\n10g d''huile d''olive\r\n--> Tout mettre dans un bol dans cet ordre, puis frigo (1h au frigo)\r\n\r\n(Verser le contenu  plat trs fin, four 205)\r\n--> Laisser refroidir 10/15min\r\n--> Dcouper  l''emporte pice\r\n\r\n1 carotte jaune + 1 carotte violet : 1/4 carotte de chaque par personne\r\nPiment d''espelette\r\nSel\r\nPoivre\r\nHuile d''olive\r\n--> Emincer les carottes et ajouter l''assaisonnement\r\n--> AJouter le persil pour garder la couleur (anti-oxydant)\r\n\r\nPersil\r\n--> Hacher le persil  la main trs trs fin\r\n\r\n1/4 de gousse d''ail / personne\r\n--> Hacher et mlanger avec le persil\r\n\r\n80g de Viande par personne\r\n--> Ajouter le mlanger persil et ail + sel + poivre\r\n--> Ajouter une grande cuillre de moutarde pour 250g de viande\r\n--> Si tout absorb, alors ajouter de l''huile d''olive\r\n\r\nFaire des quenelles de Ricotta\r\n\r\nDresser le tout avec un emporte pice !'),
(17, 41, 86, 'Contre filet rti entier', '1main', 'Contre filet rti entier accompagn de ses petits lgumes', 'crouter la viande , reposer 5 mn puis faire une ballotine. Au four  90 jusqu'' 47  coeur . Pour dresser, lgrement napper avec de la crme de ssame puis poser les morceaux de viande en tronons. Ajouter la pure  la ciboulette + lgumes.'),
(18, 39, 88, 'Tartare de dorade sur lit de mangue', '0entry', 'Tartare de dorade sur lit de mangue', 'tranches fines de St Jacques une rose de saumon, sauce vinaigrette aux agrumes, ronds de gele  la verveine, chips  vitelotte,  peut tre qq tranches de mangue ... Je n''ai pas de photo de mon plat je joins une photo qui s''en rapproche en attendant ...'),
