INSERT INTO `restaurant` (`id`, `owner_id`, `address_city_id`, `gallery_id`, `cuisine_id`, `name`, `description`, `opening_date`, `address_street`, `address_postal_code`, `status`, `social_info_site`, `social_info_trip_advisor`, `social_info_facebook`, `contact_info_phone`, `contact_info_mobile_phone`, `contact_info_email`) VALUES
(2, 2, 1, 2, 1, '136 avenue', 'Le 136 avenue est un restaurant de cuisine franaise,  base de produits frais de saison. Stphanie et Fabrice vous accueillent dans un dcor moderne et chaleureux, pour un moment gastronomique convivial !', '2014-06-01', '136 avenue Flix Faure', '69003', 'validated', 'https://www.facebook.com/136avenue.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d5577559-Reviews-Cafe_Restaurant_136_Avenue-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/136avenue.fr', '04 78 54 75 35', '04 78 54 75 35', 'contact@136avenue.com'),
(3, 4, 1, 3, 2, 'Chez Augusto', 'Situ sur la presqule, en plein centre de Lyon, Chez Augusto fait partie de ces adresses qui cultivent fond et forme : cadre pur et soign et assiette pour gourmets. La spcialit de la maison ? LItalie, dans ce quelle a de plus gastronomique.', '2012-06-01', '6 rue Neuve', '69002', 'validated', 'http://restaurant.michelin.fr/restaurant/france/69002-lyon/augusto/3r77k7v', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d3482611-Reviews-Chez_Augusto-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Augusto.restaurant.Lyon', '04 72 19 44 29', '04 72 19 44 29', 'augusto_italien@yahoo.fr'),
(4, 6, 1, 4, 1, 'Le Moment', 'Nich au milieu darbustes,  lcart de la rue on redcouvre le bonheur dtre au calme. Vritable bulle de srnit, loin de la ville et de son brouhaha,  le Moment  vous promet des instants dlicieux.\r\nLe Lyonnais Alexandre Gaillot Drevon sest mis  la cuisine, sans doute influenc par son pre, cuisinier de formation, qui a tenu des restaurants en Isre. Cest ainsi quil prendra le chemin du lyce Rabelais, loccasion pour lui deffectuer son apprentissage  Lyon auprs dAlex Tournadre. \r\nIl propose au Moment une cuisine crative, de saison, uniquement  base de produits frais.', '2013-01-01', '33 rue de Saint Cyr', '69009', 'validated', 'http://www.restaurantlemoment.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1332187-Reviews-Le_Moment-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Le-Moment-1458261457747111/?fref=ts', '04 78 83 23 71', '06 09 51 88 62', 'alex.gourmet@hotmail.fr'),
(5, 11, 1, 5, 1, 'Le Plato', 'Le chef et propritaire Frdric Therriaud vous accueille au Plato... pour un voyage garanti aux pays des saveurs. Une cuisine frache, gnreuse, belle et savoureuse, de quoi conqurir vos papilles. Le Chef Therriaud fait son tour de march pour nous concocter de jolis mets. Le chef entend continuer lhistoire de la bonne chre de son prdcesseur, mais ceci ne lui empche pas d''ajouter sa touche personnelle. Pour lui il n''y pas de secret il faut de la passion et du savoir faire ! Et comment ne pas l''avoir acquis lorsque l''on a travaill  pour les plus grandes maisons ( Nicolas Le Bec, Christian Tetedoie, Le Gourmet de Sze, la Mre Vittet) \r\nEn Bref, au Plato, vous ferrez de jolies rencontres, des belles dcouvertes gustatives et passerez un moment convivial dans un dcor chaleureux...', '2012-01-01', '1 rue Villeneuve', '69004', 'validated', 'http://www.restaurant-leplato.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1329332-Reviews-Plato-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LePlato.lyon', '04 72 00 01 30', '04 72 00 01 30', 'contact@restaurant-leplato.fr'),
(6, 12, 1, 6, 1, 'Les Saveurs du Bistrot', 'Grce  la parfaite complicit, la mme passion,\r\nla mme vision du mtier entre Damien Combe (en salle) et Eric Hubert (en cuisine)\r\nqui se sont rencontrs au restaurant "Mon bistrot  Moi".\r\nNotre restaurant est  mi-chemin entre la cuisine bistrot et la gastronomie.\r\nLe midi et le soir notre carte des menus propose pas moins de cinq entres, cinq plats\r\ndont un poisson, trois fromages et plusieurs desserts.\r\nLe Chef, Eric Hubert accommode le choix des menus en fonction des arrivages.\r\nLa carte est varie et se dresse en fonction de la saison.', '2015-01-01', '10 rue Professeur Weil', '69006', 'validated', 'http://www.saveursdubistrot.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d8478076-Reviews-Les_Saveurs_Du_Bistrot-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Les-Saveurs-Du-Bistrot-1618790475062513/', '04 37 24 14 25', '04 37 24 14 25', 'lessaveursdubistrot@gmail.com'),
(7, 16, 1, 7, 1, 'Arsenic', 'Arsenic : un mot aussi fort que notre passion pour la cuisine\r\nParce que nous avons la volont de secouer avec nergie la cuisine traditionnelle pour lui donner un sens nouveau. \r\nAinsi est n LArt-scnique ou  La scne des nouveaux chefs . Ce lieu est un endroit unique o de jeunes chefs vont pouvoir donner libre cours  leur crativit et vous faire dcouvrir leur vision de la cuisine, pure, dcale et toute en fracheur.\r\nArsenic incarne l''volution de Chefs, issus de la nouvelle gnration et passs par le restaurant toil Christian TETEDOIE.', '2012-01-01', '132 rue Pierre Corneille', '69003', 'validated', 'http://www.arsenicrestaurant.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d4995531-Reviews-Arsenic-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/arsenicrestaurantlyon', '09 62 39 85 55', '09 62 39 85 55', 'contact@arsenicrestaurant.com'),
(8, 8, 1, 8, 1, 'Le Basilik', 'Blotti entre la Basilique de Fourvire et le thatre antique romain, sur le site prestigieux de l''Antiquaille, le Basilik vous ouvre ses portes et sa cuisine.\r\nUn concept moderne et barroque  la fois, aux couleurs chaudes et intimes...\r\nUne salle de restaurant moderne, une cuisine ouverte et vitre, un bar accueuillant, le tout reli par une coursive voute : un site magique !', '2015-09-01', '63 monte du chemin neuf', '69005', 'validated', 'http://www.lebasilik.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d3682199-Reviews-Le_BasiliK-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LeBasilik', '04 74 26 95 73', '04 74 26 95 73', 'sgonnet69@gmail.com'),
(9, 17, 3, 9, 1, 'Histoire sans faim', 'Situ sur une des plus belles places de Rochetaille sur Sane, notre restaurant vous accueille du mercredi au dimanche soir inclus. Aux beaux jours, venez profiter de notre terrasse et dguster une cuisine inventive et toujours renouvele.', '2015-07-01', 'place Claudius Peytel', '69270', 'validated', 'http://www.histoiresansfaim.fr', 'https://www.tripadvisor.fr/ShowUserReviews-g1237620-d8305665-r292715341-Histoire_sans_faim-Montauroux_Var_Provence.html', 'https://www.facebook.com/toutlemondeatable/posts/413274228860766', '04 78 35 42 38', '04 78 35 42 38', 'histoiresansfaim@hotmail.com'),
(10, 18, 1, 10, 1, 'La table d''Eugne', 'A la table d''Eugne rgne une atmosphre chaleureuse, nous sommes accueillis par une charmante serveuse aussi souriante que dynamique , toujours le petit mot pour rire. Les plats digne d''un trois toiles, belle prsentation, un mlange de saveurs, des produits frais. Les desserts maison sont divins, je vous recommande la tarte aux citrons meringues au combava, ce petit got acide exquis. ambiance chaleureuse, cuisine artistique, une adresse rue royale Lyon 1  retenir !', '2012-01-01', '18 rue Royale', '69001', 'validated', 'http://www.latabledeugene69.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d2458429-Reviews-La_table_d_Eugene-Lyon_Rhone_Rhone_Alpes.html', NULL, '04 78 72 50 16', '04 78 72 50 16', 'restaurant@latabledeugene69.com'),
(11, 19, 1, 11, 1, 'La Brunoise', 'C''est en plein centre de Villeurbanne que Luc et Grgory conjuguent leurs talents et leur nergie. Une parenthse gourmande pleine de charme et de sensibilit\r\nLuc Vinot et Ggory Biechel sont amis de longues dates, ensemble au lyce htelier  Thonon les bains c''est tout naturellement qu''ils ont ouvert ensemble ''La Brunoise''. Ils sont donc deux cuisiniers associs, c''est le plus du restaurant avoir un chef en salle : Grgory connaissait dj le service c''est avec plaisir qu''il explique  ses convives les diffrents plats.\r\n\r\nLa cuisine pour es deux experts c''est avant tout un bon produit La gastronomie c''est savoir le transformer puis le sublimer', '2012-01-01', '4 rue Alexandre Boutin', '69100 VILLEURBANNE', 'validated', 'http://labrunoise.fr/', 'https://www.tripadvisor.fr/Restaurant_Review-g207360-d1327930-Reviews-La_Brunoise_4-Villeurbanne_Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/La-Brunoise-49172533020/', '04 78 52 07 77', '04 78 52 07 77', 'labrunoise@gmail.com'),
(14, 109, 1, 16, 2, 'Lello', ' la vita  troppo corta per mangiare male \r\n\r\nUn restaurant italien  lambiance chaleureuse, o lquipe vous propose chaque jour des produits frais, selon larrivage et lhumeur du chef.\r\n\r\nDepuis juin 2014, Lello est reconnu par la Chambre de Commerce et dIndustrie italienne de Lyon, et le gouvernement italien, comme une table 100%  cucina italiana  sous le label  Ospitalit italiana .', '2013-01-01', '231 rue Paul Bert', '69003', 'validated', 'http://www.lello.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d4130967-Reviews-Lello-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LelloResto', '06 06 95 19 80', '06 06 95 19 80', 'contact@lello.fr'),
(15, 110, 1, 17, 1, 'Le Bistrot d''Arno', 'Arnaud Marichy sait de quoi il parle : son parcours, en particulier dans le bouchon lyonnais, lui a apport une belle matrise des sauces et des cuissons. Sa carte de saison reflte son attachement au beau produit.\r\n\r\nAu Bistrot dArno, on se sent vite comme chez un ami (qui aurait des mains en or). Le dcor est simple, logique, mais de bon got. On nest pas loin du bonheur', '2013-01-01', '3 rue Bugeaud', '69006', 'validated', 'https://www.facebook.com/Le-Bistrot-dArno-239043989636196#_=_', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d7295374-Reviews-Le_Bistrot_d_Arno-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Le-Bistrot-dArno-239043989636196#_=_', '04 78 24 49 51', '04 78 24 49 51', 'lebistrotdarno@hotmail.com'),
(16, 111, 1, 18, 1, 'Au Pr Fleuri', 'Ouvert trs rcemment, le pr fleuri assume ses tendances viandesques. La peinture couleur ardoise met en valeur les bibelots bovins dposs  et l. Une rapide lecture de la carte confirme ce pressentiment : on vient ici pour manger de la viande, et de la bonne : la cuisine se fournit chez Beauvallet, ngociant dAmbrieu-en-Bugey. Stphane, le patron, met  laise tout le monde, pour notre plus grand plaisir !', '2016-01-01', '123 rue de Sze', '69006', 'validated', 'https://www.facebook.com/restoviandeauprefleuri', NULL, 'https://www.facebook.com/restoviandeauprefleuri', '04 72 75 08 02', '04 72 75 08 02', 'restoviandeauprefleuri@gmail.com'),
(17, 112, 1, 19, 2, 'Momento Sapori e Vini', 'Franois Heiligenstein, Herv Leuci et toute son quipe vous proposent de dcouvrir une cuisine italienne de terroir et de qualit... Alors dgusterez vous des raviolis  la truffe blanche d''Alba, un tiramisu au saumon et sa sauce au topinambour ou alors vous laisserez vous tenter par les antipastis maison ? A moins que vous ne russissiez  faire votre choix entre la tatin de figues au balsamique et sa quenelle de mascarpone et les profiteroles  la Glace Pralin, Sauce au Chocolat Blanc, mais il reste toujours la promesse d''une assiette pleine de gourmandise !', '2006-01-01', '4 rue Fleurieu', '69002', 'validated', 'https://www.facebook.com/Momento-Sapori-e-Vini-240741932617606/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1118704-Reviews-MOMENTO_SAPORI_E_VINI-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Momento-Sapori-e-Vini-240741932617606/', '04 78 37 00 54', '04 78 37 00 54', 'momento.lyon@bbox.fr'),
(18, 114, 1, 20, 1, 'Alex Restaurant', 'Tons gris et rouge dans une dcoration contemporaine, la maison de Marie-Claude et dAlex Tournadre ne manque pas dallure. Lyonnais dadoption et normand dorigine, Alex pratique une belle cuisine de got. Fidle aux classiques quil revisite avec talent et travaillant des produits de saison rigoureusement slectionns, il aime surprendre son monde dans des partitions aux saveurs tonnantes souvent mconnues qui font toujours mouche. Le petit menu  midi en semaine est une vritable aubaine.', '2006-01-01', '44 boulevard des Brotteaux', '69006', 'validated', 'http://www.alexlyon.fr/alex/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d2092770-Reviews-Alex_Restaurant-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/alexrestaurantlyon/', '04 78 52 30 11', '04 78 52 30 11', 'chez.alex@club-internet.fr'),
(19, 179, 1, 21, 2, 'DUE MAURIZIO', 'Fort de ses titres de Meilleur Restaurant Italien de France, Maurizio Bullano du restaurant DUE situ  Lyon vous fait voyager en Italie  travers loriginalit des plats servis.\r\nMaurizio Bullano est sans doute un des chefs italiens les plus connus de Lyon.  Il propose une cuisine traditionnelle italienne de grande qualit et met  lhonneur poissons et crustacs. Ces plats  la carte sont renouvels tous les quinze jours, et mme si le restaurant ne paye pas mine, tout le monde sy presse !', '2000-01-01', '8 rue jouffroy', '69009', 'validated', 'http://www.mauriziobullano.com', NULL, 'https://www.facebook.com/RistoranteDueByMaurizio/', '04 72 38 26 43', '06 70 66 06 58', 'maurizio.bullano@yahoo.fr'),
(20, 183, 1, 22, 1, 'Mr Edgar', 'Nouveau venu sur le plateau de la Croix-Rousse, Edgar vous propose une carte de produits frais de saison accompagne de vins  prix doux, le tout accompagn d''un service irrprochable. On craque pour son joli cadre, avec une dco vintage et industrielle.', '2015-05-19', '4 bis rue de Belfort', '69004', 'validated', 'https://www.facebook.com/restaurant.mr.edgar/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d8599317-Reviews-Mr_Edgar-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/restaurant.mr.edgar/', '06 65 32 56 14', '04 78 61 73 13', 'mredgar@orange.fr'),
(21, 185, 1, 23, 1, 'L''EPISENS', 'Situ au cur de la presqu''le de Lyon, l''Episens vous accueille avec une cuisine moderne et raffine qui veillera vos sens !', '2015-11-16', '8 rue Palais Grillet', '69002', 'validated', 'http://www.restaurant-lepisens.fr/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d9696020-Reviews-L_Episens-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Lepisensrestaurant', '04 30 22 03 34', '04 30 22 03 34', 'restaurantlepisens@gmail.com'),
(22, 360, 1, 26, 4, 'Five', 'FIVE, le restaurant des amoureux du bien manger\r\n\r\nFIVE est un restaurant o le bien manger est rig en art-de-vivre. C''est pourquoi nous avons pris le parti de proposer des plats toujours gourmands mais en faisant en sorte de les rendre les plus quilibrs et sains possibles en utilisant des produits frais, en proposant uniquement du fait-maison et en supprimant tous les ingrdients que notre organisme a naturellement du mal  digrer, dont le principal est le gluten.\r\nFIVE est donc le premier restaurant-picerie lyonnais 100 % libre de gluten, et avec des allergnes limits et trs clairement identifis, comme le lactose.\r\n\r\nNotre souhait cest donc de proposer une nouveau mode dalimentation, plus sain, plus quilibr et adapt  tous.', '2015-12-25', '69 rue Moncey', '69003', 'validated', 'http://www.restaurantfive.com/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d10027485-Reviews-Five-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/fiverestaurants/', '0954110576', '0762822664', 'restaurantfive@yahoo.fr');
